import React from "react";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import Login from "./login";


function UserRoutes() {

    return (

        <Router>
            <Switch>
                <Route path="/login">
                    <Login></Login>
                </Route>
            </Switch>
        </Router>

    );

}

export default UserRoutes;
